import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './LaunchPage.css';

function LaunchPage() {
  const [prompt, setPrompt] = useState('');
  const [genre, setGenre] = useState('');
  const [duration, setDuration] = useState(20);
  const [musicId, setMusicId] = useState(null);
  const [saveMessage, setSaveMessage] = useState(''); // New state for the success message
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log('Submitted:', { prompt, genre, duration });
    try {
      // Send data to the backend
      const response = await fetch('http://localhost:5000/api/music', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ prompt, genre, duration }),
      });
  
      if (response.ok) {
        const data = await response.json();
        setMusicId(data._id);
        console.log('Music data saved successfully:', data);

        // Set success message
        setSaveMessage(`The following information was stored in the database:
                        Prompt: ${data.prompt},
                        Genre: ${data.genre},
                        Duration: ${data.duration} seconds`);
      } else {
        console.error('Failed to save music data');
      }
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  const handleBack = () => {
    navigate(-1);
  };

  const genres = ['Pop', 'Rock', 'Hip Hop', 'Jazz', 'Classical', 'Electronic', 'Country'];

  return (
    <div className="launch-page">
      <div className="music-background"></div>
      <button className="back-btn" onClick={handleBack}>ðŸ¢€</button>

      <form className="launch-form" onSubmit={handleSubmit}>
        <h2>Create Your Music</h2>
        <div className="form-group">
          <label htmlFor="prompt">Prompt:</label>
          <textarea
            id="prompt"
            value={prompt}
            onChange={(e) => setPrompt(e.target.value)}
          />
        </div>

        <div className="form-group">
          <label htmlFor="genre">Genre:</label>
          <select
            id="genre"
            value={genre}
            onChange={(e) => setGenre(e.target.value)}
          >
            <option value="">Select a genre</option>
            {genres.map((g) => (
              <option key={g} value={g}>{g}</option>
            ))}
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="duration">Duration: {duration} seconds</label>
          <input
            type="range"
            id="duration"
            min="10"
            max="30"
            value={duration}
            onChange={(e) => setDuration(e.target.value)}
          />
        </div>

        <div className="form-group">
          <button type="submit" className="submit-btn">
            Create Music
          </button>
        </div>
      </form>

      {/* Display the success message */}
      {saveMessage && (
        <div className="save-message">
          <p>{saveMessage}</p>
        </div>
      )}

      {musicId && (
        <div className="music-player">
          <h3>Generated Music</h3>
          <audio controls>
            <source src={`http://localhost:5000/music/${musicId}`} type="audio/mpeg" />
            Your browser does not support the audio element.
          </audio>
        </div>
      )}
    </div>
  );
}

export default LaunchPage;
